import './App.css';
import Navbar from './components/Navbar';
import Home from './pages/Home';
import Projects from './pages/Projects';
import Contact from './pages/Contact';



function App() {
  let component
    switch (window.location.pathname){
        case "/":
            component = <App />
            break
        case "/home":
            component = <Home />
            break
        case "/projects":
            component = <Projects />
            break
        case "/contact":
            component = <Contact />
            break
  }
  return (
    <div className="App">
      <Navbar />
      {component}
    </div>
  );
}

export default App;
